import React from 'react';

const Button = ({ variant = 'primary', size = 'medium', children, ...props }) => {
  const buttonClass = `nv-cta-${variant}${size !== 'medium' ? `--${size}` : ''}`;

  return (
    <button className={buttonClass} {...props}>
      {children}
    </button>
  );
};

export default Button;
